import React, { useContext } from 'react'
import { UserContext } from './Routing';

const userInfo = useContext(UserContext);
const TodoList = () => {
  console.log(userInfo.firstname);
  return (
    <>
    <div>
      {userInfo.firstname}
    </div>
    </>
  )
}

export default TodoList
